!function(){Template.__define__("disclaimer",function(){var e=this;return HTML.Raw('<h1>Legal</h1><blockquote><small>Exclusive to Chaos Box Mods, L.L.C.\nThis product is for advanced vapers only and requires technical knowledge in order to use it.\nDO NOT purchase if you are not comfortable or experienced with these types of mechanical mods.\n<br>\n<br>\n<div class="text-primary">NOTE:</div>\nA rebuildable coil/wick must be tested carefully with an ohm meter before use.\nAs a consumer, you are using our products entirely at your own risk.\nFaulty wicks/coils CAN and WILL damage electronic devices.\nNew coil/wick units must be tested and then used first on a strong basic electrical APV that has short circuit protections.\nNo coil/wick assembly should be used on an electronic device until known to be safe.\n<br>\n<br>\n<div class="text-warning">Disclaimer:</div>\nMechanical mods are for advanced vapers only with access to multimeters, high discharge batteries, and a working knowledge of how electoronic devices work.\nPlease ensure care is taken as to not cause damage/harm to your device, atomizer, mod, or yourself.\nUpon purchasing this product you agree that Chaos Box Mods, L.L.C. will not be held responsible for any injuries or property damage caused by use or misuse of this product.\nChaos Box Mods are suggested to be used with 2 x flat top 26650 40A plus batteries, and coil resistance should be kept above .2 ohm\'s.\n<br>\n<br>\n<div class="text-primary">Warranty:</div>\nChaos Box Mods, L.L.C. manufactures in Mississippi and offers a lifetime warranty on workmanship on our products/devices.\nThis warranty includes any mechanical defects or electrical issues the consumer may experience.\nThe device should be returned to us at the consumer\'s cost with a valid tracking number and insurance.\nChaos Box Mods, L.L.C. will then repair or replace your product after close inspection confirming the product has been used in compliance with this contract.\nChaos Box Mods, L.L.C. will pay for the return shipping to you with tracking and insurance.\nPlease note that your local B&amp;M sales policies are in full effect, and Chaos Box Mods, L.L.C. will not repair/replace any product that is found to be used improperly.\nFor further information please do not hesitate to contact us so that we can do our very best to assist you.</small></blockquote>')})}();

